openapi: 3.0.0
info:
  title: final-project-backend
  version: 1.0.0
servers:
  - url: http://{{base_url}}
tags:
  - name: Auth
  - name: Users
  - name: Menu
  - name: OrderItem
  - name: Order
  - name: Reviews
  - name: Coupons
  - name: Games
  - name: Promotions
  - name: Deliveries
paths:
  /login:
    post:
      tags:
        - Auth
      summary: Login
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                email: charlie.doe@mail.com
                password: password
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /register:
    post:
      tags:
        - Auth
      summary: Register
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                fullName: Rafly Nagachi
                phone: '+6281234567890'
                address: >-
                  Jl. Santai, Kec. Buay Madang, Kab. OKU Timur, Prov. Sumatera
                  Selatan
                email: rafly.nagachi@mail.com
                password: password
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /users/4:
    get:
      tags:
        - Users
      summary: GetProfileDetail
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
    patch:
      tags:
        - Users
      summary: UpdateProfile
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                fullName: Charlie Official
                phone: '+6281234567800'
                address: >-
                  Jl. Santai, Kec. Buay Madang, Kab. OKU Timur, Prov. Sumatera
                  Selatan
                email: charlie.doe@mail.com
                password: password
                profilePicture: >-
                  
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /menus:
    get:
      tags:
        - Menu
      summary: FindAll
      parameters:
        - name: category
          in: query
          schema:
            type: string
          example: CofFee
        - name: sortBy
          in: query
          schema:
            type: string
          example: price
        - name: sort
          in: query
          schema:
            type: string
          example: desc
        - name: search
          in: query
          schema:
            type: string
          example: milk
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
    post:
      tags:
        - Menu
      summary: CreateMenu
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                categoryID: 2
                name: Milk tea
                price: 15000
                image: >-
                  
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /menus/1:
    get:
      tags:
        - Menu
      summary: GetMenuDetail
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
    patch:
      tags:
        - Menu
      summary: UpdateMenuByID
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                categoryID: 2
                name: Lemon tea
                price: 15000
                image: >-
                  
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /menus/10:
    delete:
      tags:
        - Menu
      summary: DeleteMenuByID
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /order-items:
    post:
      tags:
        - OrderItem
      summary: CreateOrderItem
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                menuID: 2
                quantity: 2
                description: toppings:boba
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
    get:
      tags:
        - OrderItem
      summary: GetOrderItems
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /order-items/1:
    patch:
      tags:
        - OrderItem
      summary: UpdateOrderItems
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                quantity: 3
                description: size:large,toppings:boba
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
    delete:
      tags:
        - OrderItem
      summary: DeleteOrderItem
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /orders:
    post:
      tags:
        - Order
      summary: CreateOrder
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                paymentOptID: 1
                orderedDate: '2021-08-21T17:59:59Z'
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
    get:
      tags:
        - Order
      summary: GetOrder
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /internal/orders:
    get:
      tags:
        - Order
      summary: GetOrder
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /orders/2:
    get:
      tags:
        - Order
      summary: GetOrderByID
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /reviews:
    post:
      tags:
        - Reviews
      summary: CreateReview
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                menuID: 1
                rating: 5
                description: Mantap
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /menus/1/reviews:
    get:
      tags:
        - Reviews
      summary: GetReviewByMenuID
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /coupons:
    post:
      tags:
        - Coupons
      summary: CreateCoupon
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                name: Special Discount HUT Kopi Santai
                amount: 30
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /coupons/3:
    delete:
      tags:
        - Coupons
      summary: DeleteCouponByID
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /games:
    get:
      tags:
        - Games
      summary: GetLeaderboards
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /games/4:
    get:
      tags:
        - Games
      summary: GetUserScore
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /game-prize:
    post:
      tags:
        - Games
      summary: GamePrize
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                score: 10
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /promotions:
    get:
      tags:
        - Promotions
      summary: GetPromotions
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /deliveries/1:
    patch:
      tags:
        - Deliveries
      summary: New Request
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                status: IN PROCESS
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
